import React from "react";
import logo from "../../assets/logo1.jpeg";
import { Link } from "react-router-dom";
import "../../styles/navbar.css";

function Navbar() {
  return (
    <nav className="navbar">
      <label className="logo">
        <img src={logo} />
      </label>
    </nav>
  );
}

export default Navbar;
